import { Component } from 'react';
import Artboards from '../Artboards';
import FormContainer from '../FormContainer/FormContainer';
import ScrollBar from '../ScrollBar/ScrollBar';
import TemplatePicker from '../TemplatePicker/TemplatePicker';
import classes from './Workspace.module.css';


class Workspace extends Component {

    state = {
        isInfoFilled: false,
        pickedTemplate: null,
        zoom: 100,
        userInfo:  {
            "personal":{
               "image": ``,
               "name":"Nishant",
               "dob":"1999-11-25",
               "gender":"male",
               "email":"knishant113@gmail.com",
               "phone":"7838716089"
            },
            "education":{
               "university":"IGNOU",
               "degree":"BCA",
               "startDate":"2017-01-01",
               "endDate":"2020-01-01"
            },
            "projects":[
               {
                  "title":"WebDraw",
                  "description":"This is web based drawing tool made with JavaScript (vue.js) which contain functions related to print and save the drawings",
                  "url":"nishanttheprogrammer.github.io/WebDraw"
               },
               {
                  "title":"Resume Builder",
                  "description":"It's a react application for build your resume on the web, which will container some pre made template and there'll be lot of customization options available",
                  "url":"resumebuilder.nishanttheprogrammer.com"
               },
               {
                  "title":"Bus Management System",
                  "description":"This is the final year project for my university (Indira Gandhi National Open University) for BCA",
                  "url":""
               }
            ],
            "skills":[
               "html",
               "css",
               "JavaScript",
               "python",
               "php",
               "java",
               "c",
               "vue.js",
               "laravel"
            ]
         }
    }


render() {
   const Artboard = this.state.pickedTemplate !== null ? Artboards[this.state.pickedTemplate] : null;
   
      
    return (
        <div className={[classes.workspace, (this.state.pickedTemplate !== null || !this.state.isInfoFilled) && classes.noElement].join(' ')}>
            {
               !this.state.isInfoFilled 
                  ?  <FormContainer completed={userInfo => setTimeout(() => {
                        this.setState({ userInfo, isInfoFilled: true })
                     }, 5000)} />        // after animation done
                  : (this.state.pickedTemplate === null) 
                     ? <TemplatePicker size={40} {...this.state.userInfo} onSetArtboard={picked => this.setState({pickedTemplate: picked}) }  /> 
                     : ( 
                        <>
                           <ScrollBar zoom={this.state.zoom} onZoomChange={e => this.setState({zoom: e.target.value})}/>
                           <Artboard zoom={this.state.zoom} {...this.state.userInfo}/>
                        </>
                     ) 
            }
        </div>
    );
}
}

export default Workspace